import React, { Component } from "react";

class NavBar extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <nav class="navbar navbar-light bg-light">
          <a class="navbar-brand" href="#">
            Bootstrap
          </a>
        </nav>
      </React.Fragment>
    );
  }
}

export default NavBar;
